

-- ================================================================
-- Tabla: users
-- ================================================================

DROP TABLE IF EXISTS "users" CASCADE;
CREATE TABLE "users" ("id" UUID NOT NULL, "email" VARCHAR(255) NOT NULL, "password_hash" TEXT NOT NULL, "password_updated_at" TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(), "full_name" TEXT NOT NULL, "role" user_role NOT NULL, "is_active" BOOLEAN NOT NULL DEFAULT true, "applicant_id" UUID, "last_login_at" TIMESTAMP WITH TIME ZONE, "created_at" TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(), "updated_at" TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now());

ALTER TABLE "users" ADD PRIMARY KEY ("id");



